INSERT INTO `xlite_custom_global_tab_translation` VALUES (1,1,'Shipping info','We deliver worldwide','To replace this text with your store\'s actual shipping info, go to \"Catalog -> Product tabs\" and edit the Shipping info page.','en'),(2,1,'','    ','             ,    \" ->   \"    \"\".','ru'),(3,2,'Payment methods','<p><img class=\"fr-draggable fr-dii fr-fil\" src=\"skins/customer/images/demo/tabs/logos-payments-tab.png\" alt=\"Accepted payment methods\" style=\"width:300px;\" /></p>','<p>We accept the following payment methods:</p><p><img class=\"fr-draggable fr-dii\" src=\"skins/customer/images/demo/tabs/logos-payments-tab.png\" style=\"width:400px;\" /></p><p>To replace this text with your store\'s actual info on payment methods, go to \"Catalog -&gt; Product tabs\" and edit the Payment methods page.</p>','en'),(4,2,' ','<p><img class=\"fr-draggable fr-dii fr-fil\" src=\"skins/customer/images/demo/tabs/logos-payments-tab.png\" alt=\" \" style=\"width:300px;\" /></p>','<p>    :</p><p><img class=\"fr-draggable fr-dii\" src=\"skins/customer/images/demo/tabs/logos-payments-tab.png\" style=\"width:400px;\" /></p><p>             ,    \" ->   \"    \" \".</p>','ru'),(5,3,'Return Policy','We accept returns','This page is intended for your policy regarding returns and refunds.<br/><br/> Here you can provide information as to what products can be returned, how many days your customers have to return their purchase, whether they will receive a refund in the original form of payment, a replacement or a store credit, who pays for the shipping of the previously purchased products to the store, and so on.<br/><br/> To replace this text with your store\'s actual return policy, go to \"Catalog -> Product tabs\" and edit the Return Policy page.','en'),(6,3,'   ','  ','           .<br/><br/>    ,      ,          ,         ,             ,         ,   .<br/><br/>               ,    \" ->   \"    \"   \".','ru');
